// import Link from 'next/link';
import Layout from './container/common/layout';
import css from '../styles/index.css';
// import Image from 'next/image';
// import Main from "../pages/component/main/main"

const Index = () => (
  <div class="container" className={css.container}>
    <Layout>
      <section>
        <nav class="nav" className={css.nav}>
          <span class="blend" className={css.blend}>
            <h1>MK Co., Ltd.</h1>
          </span>
        </nav>
        <div class="main" className={css.main}>
          <h2>What We Do</h2>
          <p>
            저희 엠케이는 경북 영천시에 소재하고 있고 2019년 1월 21일에 설립되어
          </p>
          <p>
            소프트웨어 개발 및 제작과 자동차 부품을 가공하여 공급하고 있습니다.
          </p>
          <p>
            또 4차 산업시대에 발맞춰 부품 생산 자동화 시스템을 개발하려는 등
            끊임없는 도전을 하고 있습니다.
          </p>
        </div>
      </section>
    </Layout>
  </div>
);

export default Index;
